import React from 'react';
import './split.css';

interface RangeSliderProps {
  min: number;
  max: number;
  valueA: number;
  valueB: number;
  onValueChangeA: (value: number) => void;
  onValueChangeB: (value: number) => void;
}

const RangeSlider: React.FC<RangeSliderProps> = ({
  min,
  max,
  valueA,
  valueB,
  onValueChangeA,
  onValueChangeB,
}) => {
  const handleValueChangeA = (event: React.ChangeEvent<HTMLInputElement>) => {
    const value = parseFloat(event.target.value);
    onValueChangeA(value);
  };

  const handleValueChangeB = (event: React.ChangeEvent<HTMLInputElement>) => {
    const value = parseFloat(event.target.value);
    onValueChangeB(value);
  };

  return (
    <div className="range-slider overlay">
      <input
        type="range"
        min={min}
        max={max}
        value={valueA}
        onChange={handleValueChangeA}
      />
      <input
        type="range"
        min={min}
        max={max}
        value={valueB}
        onChange={handleValueChangeB}
      />
      <div className="range-slider__values">
        {Array.from({ length: max + 1 }, (_, i) => i).join(' ')}
      </div>
      <div className="range-slider__progress" />
    </div>
  );
};

export default RangeSlider;
